import './style.css'

const teams = [
  {
    name: 'FC Barcelona',
    foundationYear: 1899,
    stadium: 'Spotify Camp Nou',
    logo: 'data:image/png;base64,'
  },
  {
    name: 'Real Madrid CF',
    foundationYear: 1902,
    stadium: 'Santiago Bernabéu',
    logo: 'data:image/png;base64,'
  },
  {
    name: 'Club Atlético de Madrid',
    foundationYear: 1903,
    stadium: 'Cívitas Metropolitano',
    logo: 'data:image/png;base64,'
  },
  {
    name: 'Sevilla Fútbol Club',
    foundationYear: 1890,
    stadium: 'Ramón Sánchez-Pizjuán',
    logo: 'data:image/jpeg;base64,'
  },
];

const init = () => {
  getData();  
}

const getData = () =>  {

  transformData(teams);
}


const transformData = (list) => {

  const listTransformed = list.map((item) => {
    return {
      name: item.name, 
      foundationYear: item.foundationYear, 
      stadium: item.stadium, 
      logo: item.logo
    }
  })

  templateList(listTransformed);
}

const templateList = (list) => {
  list.forEach(element => {
    const elementHtml = `
    <div class="container-team">
      <h2>${element.name}<h2>
      <img src=${element.logo} alt='logo'>
      <p>${element.stadium}</p>
      <p>${element.foundationYear}</p>
    </div>
    `

    addTemplateToDom(elementHtml);
  });
}

const addTemplateToDom = (template) => {
  document.querySelector('#app').innerHTML += template
}


init();


